// ========== HELPER FUNCTIONS ==========

// Helper function to get unique areas
export const getUniqueAreas = (type: 'apar' | 'hydrant' | 'smoke' | 'eyewash'): string[] => {
    switch (type) {
        case 'eyewash':
            return [...new Set(EYEWASH_LOCATIONS.map(item => item.area))].sort();
        case 'smoke':
            return [...new Set(SMOKE_DETECTOR_LOCATIONS.map(item => item.area))].sort();
        case 'hydrant':
            return [...new Set(HYDRANT_LOCATIONS.map(item => item.area))].sort();
        case 'apar':
            return [...new Set(APAR_LOCATIONS.map(item => item.area))].sort();
        default:
            return [];
    }
};

export const getLocationsByArea = (type: 'apar' | 'hydrant' | 'smoke' | 'eyewash', area: string): string[] => {
    switch (type) {
        case 'eyewash':
            return [...new Set(EYEWASH_LOCATIONS.filter(item => item.area === area).map(item => item.location))].sort();
        case 'smoke':
            return [...new Set(SMOKE_DETECTOR_LOCATIONS.filter(item => item.area === area).map(item => item.location))].sort();
        case 'hydrant':
            return [...new Set(HYDRANT_LOCATIONS.filter(item => item.area === area).map(item => item.location))].sort();
        case 'apar':
            return [...new Set(APAR_LOCATIONS.filter(item => item.area === area).map(item => item.location))].sort();
        default:
            return [];
    }
};

export interface LocationWithTag {
    displayName: string;
    location: string;
    tagNumber: string | number;
    regNumber: string;
}

export const getLocationsWithTagByArea = (type: 'apar' | 'hydrant' | 'smoke' | 'eyewash', area: string): LocationWithTag[] => {
    switch (type) {
        case 'eyewash':
            return EYEWASH_LOCATIONS
                .filter(item => item.area === area)
                .map(item => ({
                    displayName: `${item.location} - No.${item.tagNumber}`,
                    location: item.location,
                    tagNumber: item.tagNumber,
                    regNumber: item.regNumber
                }));
        case 'smoke':
            return SMOKE_DETECTOR_LOCATIONS
                .filter(item => item.area === area)
                .map(item => ({
                    displayName: `${item.location} - ${item.tagNumber}`,
                    location: item.location,
                    tagNumber: item.tagNumber,
                    regNumber: item.regNumber
                }));
        case 'hydrant':
            return HYDRANT_LOCATIONS
                .filter(item => item.area === area)
                .map(item => ({
                    displayName: `${item.location} - ${item.tagNumber}`,
                    location: item.location,
                    tagNumber: item.tagNumber,
                    regNumber: item.regNumber
                }));
        case 'apar':
            return APAR_LOCATIONS
                .filter(item => item.area === area)
                .map(item => ({
                    displayName: `${item.location} - ${item.tagNumber}`,
                    location: item.location,
                    tagNumber: item.tagNumber,
                    regNumber: item.regNumber
                }));
        default:
            return [];
    }
};

export const APAR_CAPACITIES = ['3 Kg', '6 Kg', '9 Kg', '12 Kg', '25 Kg', '50 Kg'];

export const TAG_PREFIXES = {
    apar: 'APR-',
    hydrant: 'HYD-',
    smoke: 'SD-',
    eyewash: 'EW-'
} as const;

export const formatTagNumber = (type: keyof typeof TAG_PREFIXES, number: string | number): string => {
    const num = typeof number === 'string' ? parseInt(number, 10) : number;
    if (isNaN(num) || num < 0) return `${TAG_PREFIXES[type]}000`;
    const padded = String(num).padStart(3, '0');
    return `${TAG_PREFIXES[type]}${padded}`;
};

export const parseTagNumber = (tagNumber: string): string => {
    const match = tagNumber.match(/(\d+)$/);
    return match ? match[1] : '';
};
